import React from 'react';
import './Style.css'
import { NavLink as Link } from 'react-router-dom';

const sections = [
	{title: 'Remerciements', link: '/InternshipReport/Remerciements'},
	{title: 'Plan', link: '/InternshipReport/Plan'},
	{title: 'Introduction', link: '/InternshipReport/Introduction'},
	{title: 'Développement', link: '/InternshipReport/Développement'},
	{title: 'Conclusion', link: '/InternshipReport/Conclusion'},
];

const Plan = ({ closeMobileMenu }) => {
    return (
        <div>
            <ul>
                {}
            </ul>

            <h1 className='center-text' style={{color: 'orange', marginTop: '15vh', fontSize: 45}}>
                Sommaire
            </h1>
            <div className='two-link'>
                <Link style={{color: 'blue'}} to='/InternshipReport/Remerciements' onClick={closeMobileMenu}>
                    <i class="fa-solid fa-angle-left fa-3x"></i>
                </Link>
                <i class="fa-solid fa-ellipsis-vertical fa-3x" style={{color: 'blue'}}></i>
                <Link style={{color: 'blue'}} to='/InternshipReport/Introduction' onClick={closeMobileMenu}>
                    <i class="fa-solid fa-angle-right fa-3x"></i>
                </Link>
            </div>
        </div>
    );
};

export default Plan;
